import React from "react";
import { NavLink } from "react-router-dom";

const BeerPic = ({ beer }) => {
  const handleClick = (e) => {
    e.preventDefault();
    let beerId = beer.id;
    let beerName = beer.name;
    console.log(beerId, beerName);
    // let path = `beers/${beer.id}/${beer.name}`;
    //this.props.history.push(path);
  };
  // href={beer.image_url} target="_blank" rel="noopener noreferrer"
  return (
    <NavLink exact to={`/${beer.id}/${beer.name}`}>
      <div className="beer-card" onClick={(e) => handleClick(e)}>
        <img src={beer.image_url} alt={beer.name} className="beer-image"></img>
        <div className="pic-name">{beer.id + "-" + " " + beer.name}</div>
      </div>
    </NavLink>
  );
};

export default BeerPic;
